// @flow

import GCSDispatcher from 'js/dispatcher/GCSDispatcher';
import { CalibrationTypes } from 'js/constants/ActionTypes';

/**
 * Adds the given line to the calibration output
 * @param {string} line
 * @returns {undefined}
 */
export function addCalibrationLine(line: string): void {
  GCSDispatcher.dispatch({
    type: CalibrationTypes.ADD_CALIBRATION_LINE,
    line
  });
}

/**
 * Clears the calibration output
 * @returns {undefined}
 */
export function clearCalibrationLines(): void {
  GCSDispatcher.dispatch({
    type: CalibrationTypes.CLEAR_CALIBRATION
  });
}

