import GCSDispatcher from 'js/dispatcher/GCSDispatcher';
import { FenceTypes } from 'js/constants/ActionTypes';

/**
 * Changes the geofence points in the store/map
 * Used when loading geofence
 * @param {Point[]} points
 * @returns {undefined}
 */
export function receiveFencePoints(points: Point[]): void {
  GCSDispatcher.dispatch({
    type: FenceTypes.RECEIVE_FENCE_POINTS,
    points
  });
}

/**
 * Changes the fences value in the store/display
 * Used to toggle fences in map
 * @param {boolean} enabled
 * @returns {undefined}
 */
export function receiveFencesEnabled(enabled: boolean): void {
  GCSDispatcher.dispatch({
    type: FenceTypes.RECEIVE_FENCES_ENABLED,
    enabled
  });
}

