import GCSDispatcher from 'js/dispatcher/GCSDispatcher';
import { InteropTypes } from 'js/constants/ActionTypes';

/**
 * Relays that the interop server is active (does not say if it is working)
 * @param {boolean} active
 * @returns {undefined}
 */
export function receiveInteropActive(active: boolean): void {
  GCSDispatcher.dispatch({
    type: InteropTypes.RECEIVE_INTEROP_ACTIVE,
    active
  });
}

/**
 * Relays that the interop server is working
 * @param {boolean} alive
 * @returns {undefined}
 */
export function receiveInteropAlive(alive: boolean): void {
  GCSDispatcher.dispatch({
    type: InteropTypes.RECEIVE_INTEROP_ALIVE,
    alive
  });
}

/**
 * Sets the obstacle list to the argument
 * @param {Obstacle[]} obstacles
 * @returns {undefined}
 */
export function receiveObstacles(obstacles: Obstacle[]): void {
  GCSDispatcher.dispatch({
    type: InteropTypes.RECEIVE_OBSTACLES,
    obstacles
  });
}

/**
 * Sets the off-axis target coordinates
 * @param {Point} off_axis
 * @returns {undefined}
 */
export function receiveOffAxis(off_axis: Point): void {
  GCSDispatcher.dispatch({
    type: InteropTypes.RECEIVE_OFF_AXIS,
    off_axis
  });
}

