import {} from 'js/dispatcher/GCSDispatcher';

/* eslint-disable no-undef */
/**
 * @typedef {Object} Point
 * @property {number} lat
 * @property {number} lon
 */
declare type Point = {
  lat: number,
  lon: number
};

/**
 * @typedef {Object} Sphere
 * @property {number} latitude
 * @property {number} longitude
 * @property {number} sphere_radius
 * @property {number} altitude_msl - Height of center above mean sea level
 */
declare type Sphere = {
