  if (!_.isEqual(off_axis.lat, _old_off_axis.lat) || !_.isEqual(off_axis.lon, _old_off_axis.lon)) {
    offAxisMarker.setLatLng([off_axis.lat, off_axis.lon]);
  }
  _old_off_axis = off_axis;
}

