  'MANUAL': 0, 'CIRCLE': 1, 'STABILIZE':2, 'TRAINING':3, 'ACRO':4, 'FBWA':5,
  'FBWB':6, 'CRUISE':7, 'AUTOTUNE':8,  'AUTO':10, 'RTL':11, 'LOITER':12, 'GUIDED':15
